
using Microsoft.Extensions.DependencyInjection;
using Moq;
using SCAPE.API;
using SCAPE.API.Controllers;
using SCAPE.Application.Interfaces;
using SCAPE.Application.Services;
using SCAPE.Domain.Entities;
using SCAPE.Domain.Exceptions;
using SCAPE.Domain.Interfaces;
using SCAPE.Infraestructure.FaceRecognition;
using System;
using System.Threading.Tasks;
using Xunit;

namespace SCAPE.UnitTests
{
    public class AssociateEmployeeFace
    {
        [Fact]
        public async Task associateImageValidDocumentId()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            Employee employee = new Employee {
                DocumentId = "12345",
                FirstName = "Juan",
                LastName = "Molina",
                Email = "molina@gmail.com",
                Sex = "M",
                FaceListId = "prueba"
             };   
            mock_Repository.Setup(m => m.findEmployee(It.IsAny<string>())).Returns(async () => employee);

            // Tests
            EmployeeService employeeService = new EmployeeService(mock_Repository.Object, new FaceRecognition());
            string documentId = "12345";
            //Image with face
            string encodeImage = "";

            bool response = await employeeService.associateFace(documentId, encodeImage);
            Assert.True(response);
        }

        [Fact]
        public async Task associateImageInvalidDocumentId()
        {

            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            mock_Repository.Setup(m => m.findEmployee(It.IsAny<string>())).Returns(async () => null);

            // Tests
            EmployeeService employeeService = new EmployeeService(mock_Repository.Object, new FaceRecognition());
            string documentId = "KMDL123";
            //Image with face
            string encodeImage = "";

            EmployeeDocumentException exception = await Assert.ThrowsAsync<EmployeeDocumentException>(
                () => employeeService.associateFace(documentId, encodeImage)
            );
            Assert.Equal("Employee's document is not valid", exception.Message);
        }


        [Fact]
        public async Task imageReceivedNotContainFace()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            Employee employee = new Employee
            {
                DocumentId = "123456",
                FirstName = "Pedro",
                LastName = "Perez",
                Email = "perez@gmail.com",
                Sex = "M",
                FaceListId = "prueba"
            };
            mock_Repository.Setup(m => m.findEmployee(It.IsAny<string>())).Returns(async () => employee);

            // Tests
            EmployeeService employeeService = new EmployeeService(mock_Repository.Object, new FaceRecognition());
            string documentId = "12345";
            //Image without faces
            string encodeImage = "";
           
            FaceRecognitionException exception = await Assert.ThrowsAsync<FaceRecognitionException>(
                () => employeeService.associateFace(documentId,encodeImage)
            );
            Assert.Equal("The image must contain only one face", exception.Message);
        }

        [Fact]
        public async Task imageReceivedContainTwoFaces()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            Employee employee = new Employee
            {
                DocumentId = "1234567",
                FirstName = "Claudio",
                LastName = "Pedraza",
                Email = "Pedraza@gmail.com",
                Sex = "M",
                FaceListId = "prueba"
            };
            mock_Repository.Setup(m => m.findEmployee(It.IsAny<string>())).Returns(async () => employee);

            // Tests
            EmployeeService employeeService = new EmployeeService(mock_Repository.Object, new FaceRecognition());
            string documentId = "1234567";
            //Image with 2 faces
            string encodeImage = "";

            FaceRecognitionException exception = await Assert.ThrowsAsync<FaceRecognitionException>(
                () => employeeService.associateFace(documentId,encodeImage)
            );
            Assert.Equal("The image must contain only one face", exception.Message);
        }

        [Fact]
        public async Task imageReceivedAlreadyAssociate()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            Employee employee = new Employee
            {
                DocumentId = "12345678",
                FirstName = "Maria",
                LastName = "Dolores",
                Email = "dolores@gmail.com",
                Sex = "M",
                FaceListId = "prueba"
            };
            mock_Repository.Setup(m => m.findEmployee(It.IsAny<string>())).Returns(async () => employee);

            // Tests
            EmployeeService employeeService = new EmployeeService(mock_Repository.Object, new FaceRecognition());

            //Employee without associating image
            string documentId = "12345678";
            string encodeImage = "";
            await employeeService.associateFace(documentId, encodeImage);

            //Try to associate the same image with the same employee
            FaceRecognitionException exception = await Assert.ThrowsAsync<FaceRecognitionException>(
                () => employeeService.associateFace(documentId, encodeImage)
            );
            Assert.Equal("The image has already been associated with an employee", exception.Message);
        }


    }
}
